	/*INÍCIO CLASSES PARA MENU SELECIONADO*/
	#menu li.menuSelecionado.promocionais, #menu li.menuSelecionado.nacionais,
	#menu li.menuSelecionado.internacionais, #menu li.menuSelecionado.montePacote,
	#menu li.menuSelecionado.hoteis, #menu li.menuSelecionado.cruzeiros,
	#menu li.menuSelecionado.datasEspeciais, #menu li.menuSelecionado.passeios{
		background: #fff;
		box-shadow: 0px 3px 10px #e9f0f4 inset;
		border-left: 1px solid #dbdddf;
		border-right: 1px solid #dbdddf;
		border-bottom: 1px solid #dbdddf;
		top: -1px;
	}

	/*----CORES DAS BORDAS TOPO DOS MENUS*/
	#menu li.menuSelecionado.promocionais{border-top: 2px solid #7c7d7e;}	
	#menu li.menuSelecionado.nacionais{border-top: 2px solid #00395c;}	
	#menu li.menuSelecionado.internacionais{border-top: 2px solid #ea7f1e;}	
	#menu li.menuSelecionado.montePacote {border-top: 2px solid #117255;}	
	#menu li.menuSelecionado.hoteis{border-top: 2px solid #ff3000;}	
	#menu li.menuSelecionado.cruzeiros{border-top: 2px solid #00c4db;}	
	#menu li.menuSelecionado.datasEspeciais {border-top: 2px solid #a000a2;}	
	#menu li.menuSelecionado.passeios{border-top: 2px solid #fcb034;}

	/*-----SETA FRENTE MENU-----*/
	#menu li.menuSelecionado.promocionais div.seta-baixo-menu, #menu li.menuSelecionado.nacionais .seta-baixo-menu ,
	#menu li.menuSelecionado.montePacote div.seta-baixo-menu, #menu li.menuSelecionado.cruzeiros div.seta-baixo-menu,
	#menu li.menuSelecionado.passeios div.seta-baixo-menu{
		width: 0;
		height: 0;
		border: 19px solid;
		border-color: #fbfcfd transparent transparent;
		position: absolute;
		top: 100%;
		opacity: 1;
	}

	.seta-baixo-menu{
		width: 0;
		height: 0;
		border: 19px solid;
		border-color: #fbfcfd transparent transparent;
		position: absolute;
		top: 100%;
		display: none;
		z-index: 1;
	}

	.seta-baixo-border{
		width: 0;
		height: 0;
		border: 19px solid;
		border-color: #dbdddf transparent transparent;
		position: absolute;
		top: 102%;
		display: none;
	}

	/*-----AJUSTES PARA MENU SELECIONADO-----*/
	#menu li.menuSelecionado.promocionais div.seta-baixo-menu, #menu li.menuSelecionado.promocionais div.seta-baixo-border{left: 39%; display: block;}
	#menu li.menuSelecionado.hoteis div.seta-baixo-menu, #menu li.menuSelecionado.hoteis div.seta-baixo-border{left: 32%; display: block;}
	#menu li.menuSelecionado.cruzeiros div.seta-baixo-menu, #menu li.menuSelecionado.cruzeiros div.seta-baixo-border{left: 35%; display: block;}
	#menu li.menuSelecionado.passeios div.seta-baixo-menu, #menu li.menuSelecionado.passeios div.seta-baixo-border{left: 35%; display: block;}
	#menu li.menuSelecionado.datasEspeciais div.seta-baixo-menu, #menu li.menuSelecionado.datasEspeciais div.seta-baixo-border{left: 38%; display: block;}
	#menu li.menuSelecionado.internacionais div.seta-baixo-menu, #menu li.menuSelecionado.internacionais div.seta-baixo-border{left: 40%; display: block;}
	/*FIM CLASSES PARA MENU SELECIONADO*/

/* ---------- EFEITOS ------------------ */
.transicao{
	transition:all 0.4s linear;
	-moz-transition:all 0.4s linear;
	-webkit-transition:all 0.4s linear;
	-o-transition:all 0.4s linear;
}

	.transicao:hover{
		transition:all 0.3s linear;
		-moz-transition:all 0.3s linear;
		-webkit-transition:all 0.3s linear;
		-o-transition:all 0.3s linear;
	}

.transicao2{
	transition:all 0.1s linear;
	-moz-transition:all 0.1s linear;
	-webkit-transition:all 0.1s linear;
	-o-transition:all 0.1s linear;
}	

.animado:hover {
	-webkit-animation-duration: 1s;
	   -moz-animation-duration: 1s;
	     -o-animation-duration: 1s;
	        animation-duration: 1s;
	-webkit-animation-fill-mode: both;
	   -moz-animation-fill-mode: both;
	     -o-animation-fill-mode: both;
	        animation-fill-mode: both;
}

.animado.rapido:hover {
	-webkit-animation-duration: .5s;
	   -moz-animation-duration: .5s;
	     -o-animation-duration: .5s;
	        animation-duration: .5s;
	-webkit-animation-fill-mode: both;
	   -moz-animation-fill-mode: both;
	     -o-animation-fill-mode: both;
	        animation-fill-mode: both;
}

@-webkit-keyframes pulse {
    0% { -webkit-transform: scale(1); }
	50% { -webkit-transform: scale(1.1); }
    100% { -webkit-transform: scale(1); }
}
@-moz-keyframes pulse {
    0% { -moz-transform: scale(1); }
	50% { -moz-transform: scale(1.1); }
    100% { -moz-transform: scale(1); }
}
@-o-keyframes pulse {
    0% { -o-transform: scale(1); }
	50% { -o-transform: scale(1.1); }
    100% { -o-transform: scale(1); }
}
@keyframes pulse {
    0% { transform: scale(1); }
	50% { transform: scale(1.1); }
    100% { transform: scale(1); }
}

.animado:hover.pulse:hover {
	-webkit-animation-name: pulse;
	-moz-animation-name: pulse;
	-o-animation-name: pulse;
	animation-name: pulse;
}

.zoom2{
	-webkit-transition: all 0.7s;
    -moz-transition: all 0.9s;
    -ms-transition: all 0.7s;
    -o-transition: all 0.7s;
    transition: all 0.7s;
}

.zoom2:hover{
	-webkit-transform: scale(1.1);
    -moz-transform: scale(1.1);
    -ms-transform: scale(1.1);
    -o-transform: scale(1.1);
    transform: scale(1.1);
}

@-webkit-keyframes zoomIn {
    0% { -webkit-transform: scale(1); }
	100% { -webkit-transform: scale(1.2); }
}
@-moz-keyframes zoomIn {
    0% { -moz-transform: scale(1); }
	100% { -moz-transform: scale(1.2); }
}
@-o-keyframes zoomIn {
    0% { -o-transform: scale(1); }
	100% { -o-transform: scale(1.2); }
}
@keyframes zoomIn {
    0% { transform: scale(1); }
	100% { transform: scale(1.2); }
}

.animado:hover.zoomIn:hover {
	-webkit-animation-name: zoomIn;
	-moz-animation-name: zoomIn;
	-o-animation-name: zoomIn;
	animation-name: zoomIn;
}

/*-----Animação para hover em Top 5 Hotel Urbano página de hotéis----*/
.lista-top5 li a:hover span{
	-webkit-animation-duration: .5s;
	-moz-animation-duration: .5s;
	-o-animation-duration: .5s;
	animation-duration: .5s;
	-webkit-animation-fill-mode: both;
	-moz-animation-fill-mode: both;
	-o-animation-fill-mode: both;
	animation-fill-mode: both;
	-webkit-animation-name: zoomIn;
	-moz-animation-name: zoomIn;
	-o-animation-name: zoomIn;
	animation-name: zoomIn;
}

@-moz-keyframes luminosity{
