					.menu-quartos a{
						position: relative;
						top: 10px; /* diferença na altura entre o menu selecionado e o normal */
						margin-right: 3px;
						border-top: 1px solid #d0cece;
						border-right: 1px solid #d0cece;
						border-left: 1px solid #d0cece;
						border-radius: 5px 5px 0 0;
						background: #fff;
