.calendario * {font-size:11px; font-family:Arial, Helvetica, sans-serif;}

.calendario .changeMonthYear{text-indent:-5000px; background:url(../../images/calendario/changer.jpg) center center no-repeat}

.calendario .changer a {color: #233D6D}

/* ---------- Aparencia Calendario ---------- */
.calendario {
	border:1px solid #f99518 !important;
	border-radius: 10px;
	background:#fff;
	width: 209px !important;
	height: 215px !important;
	z-index: 1;
}

.calendario .head {
	background: #003c65;
	border-radius: 9px 9px 0 0;
	border-bottom: 1px solid #f99518;
	height: 23px !important;
}

.calendario .btMonthPrev{
	text-indent:-5000px;
	background: url(../images/calendario/mes-anterior.jpg) center center no-repeat;
	margin: 2px 0 3px 10px !important;
}

.calendario .btMonthNext{
	text-indent:-5000px;
	background: url(../images/calendario/mes-posterior.jpg) center center no-repeat;
	float: right !important;
	margin: 2px 10px 3px 0 !important;
}

.calendario .title {
	color:#fff;
	text-transform: uppercase;
	font-weight: bold !important;
	width: 153px !important;
	margin-top: 3px !important;
}

.calendario .dayNames {
	font-weight: bold;
	height: 26px;
	color: #003c65;
	padding: 0 15px;
}

	.calendario .dayNames li{
		margin: 6px 3px !important;
		width: 19px !important;
	}

.calendario .days{
	padding: 0 15px;
}

	.calendario .date {
		color: #003c65;
		border: 1px solid #a4afb8 !important;
		background: #b0defe;
		height: 12px !important;
		padding: 3px 0;
		margin: 1px 3px;
		cursor: pointer;
	}

		.disabled{
			color: #999 !important;
			border: 1px solid #999 !important;
			background: #ddd !important;
			cursor: no-drop !important;
			opacity: 0.5;	
		}

.calendario .date.daysFromPreviousMonth,
.calendario .date.daysFromNextMonth{
	opacity: 0.5;
	cursor: default !important;
	visibility: hidden;
}

	.calendario .date.daysFromNextMonth:hover{
		color: #003c65;
		border: 1px solid #a4afb8 !important;
		background: #b0defe;
		cursor: pointer;
		text-decoration: none !important;
	}

		.calendario .date:hover{
			color: #fff;
			background: #003c65;
		}

	.calendario .date.today{
		border: 1px solid #ce6920 !important;
		background: #f59317;
		color: #fff;
	}

	.calendario .date.selected{
		border: 1px solid #ce6920 !important;
		background: #f59317;
		color: #fff;
	}

.calendario .footer{
	border-top: none !important;
}

	.calendario .footer a { 
		border-radius: 6px;
		background: #003c65;
		color: #fff;
		width: 50px;
		line-height: 18px;
		display: inline-block;
		box-shadow: 0px 0px 1px #000;
	}

	.calendario .footer a:hover {
		box-shadow: 0px 0px 2px #000 inset;
		text-decoration: none !important;
		margin: 2px 0 0 2px;
	}

.calendario .changer{
	z-index: 3;
	top: 28px;
	left: 13px;
	border: 1px solid #003c65;
	border-radius: 10px;
	box-shadow: 0px 0px 2px #333;
	height: 175px !important;
	padding-top: 4px;
}

	.calendario .changer .selected {
		background: #003c65;
		color: #FFF;
		text-transform: uppercase;
		box-shadow: 0px 0px 2px #333;
	}

	.separator{
		border-right-color: #003c65 !important;
	}

/* Calendario na pagina comprar - na busca por hoteis */
.confirmacao-cada-pessoa img{
	 margin: 8px 5px 7px -23px !important;
}

.confirmacao-cada-pessoa .calendario{
	top: 27px !important;
	z-index: 3;
}

