							this.sf._swfu.debug("Error Code: HTTP Error, File name: " + file.name + ", Message: " + message);
						break;
						case SWFUpload.UPLOAD_ERROR.UPLOAD_FAILED:
							this.sf.showErrors( ('{' + this.sf._swfu.settings.file_post_name + ': "Falha ao enviar arquivo."}').evalJSON() );
							this.sf._swfu.debug("Error Code: Upload Failed, File name: " + file.name + ", File size: " + file.size + ", Message: " + message);
						break;
						case SWFUpload.UPLOAD_ERROR.IO_ERROR:
							this.sf.showErrors( ('{' + this.sf._swfu.settings.file_post_name + ': "Server (IO) Error"}').evalJSON() );
							this.sf._swfu.debug("Error Code: IO Error, File name: " + file.name + ", Message: " + message);
						break;
						case SWFUpload.UPLOAD_ERROR.SECURITY_ERROR:
							this.sf.showErrors( ('{' + this.sf._swfu.settings.file_post_name + ': "Security Error"}').evalJSON() );
							this.sf._swfu.debug("Error Code: Security Error, File name: " + file.name + ", Message: " + message);
						break;
						case SWFUpload.UPLOAD_ERROR.UPLOAD_LIMIT_EXCEEDED:
							this.sf.showErrors( ('{' + this.sf._swfu.settings.file_post_name + ': "Tamanho do arquivo excedido."}').evalJSON() );
							this.sf._swfu.debug("Error Code: Upload Limit Exceeded, File name: " + file.name + ", File size: " + file.size + ", Message: " + message);
						break;
						case SWFUpload.UPLOAD_ERROR.FILE_VALIDATION_FAILED:
							this.sf.showErrors( ('{' + this.sf._swfu.settings.file_post_name + ': "Falha na validação"}').evalJSON() );
							this.sf._swfu.debug("Error Code: File Validation Failed, File name: " + file.name + ", File size: " + file.size + ", Message: " + message);
						break;
						case SWFUpload.UPLOAD_ERROR.FILE_CANCELLED:
							// If there aren't any files left (they were all cancelled) disable the cancel button
							if (this.sf._swfu.getStats().files_queued === 0 && $(this.sf._swfu.customSettings.cancelButtonId)) {
								$(this.sf._swfu.customSettings.cancelButtonId).disabled = true;
							}
							this.sf.showErrors( ('{' + this.sf._swfu.settings.file_post_name + ': "Cancelado"}').evalJSON() );
							progress.setCancelled();
						break;
						case SWFUpload.UPLOAD_ERROR.UPLOAD_STOPPED:
							this.sf.showErrors( ('{' + this.sf._swfu.settings.file_post_name + ': "Parado"}').evalJSON() );
						break;
						default:
							progress.setStatus("Unhandled Error: " + errorCode);
							this.sf._swfu.debug("Error Code: " + errorCode + ", File name: " + file.name + ", File size: " + file.size + ", Message: " + message);
						break;
					}
				} catch (ex) {
					this.sf._swfu.debug(ex);
				}

			}.bind({sf: this}),

			upload_success_handler : function (file, serverData) {
				try {
					serverData = serverData.evalJSON();

					var progress = new FileProgress(file, this.sf._swfu.customSettings.progressTarget);
					progress.setComplete();
					progress.toggleCancel(false);
				} catch (ex) {}

				try {
					if (serverData.debug) {
						Debug.printAjaxResults('Debug SWF Upload', serverData.debug, true);
					}
				} catch(e) {}

				if (serverData.sucesso) {
					this.sf.showSucesso(serverData);
					progress.setStatus('Concluido.');
				} else {
					this.sf.showErrors(serverData);
					progress.setError();
					progress.toggleCancel(false);
					this.sf._swfu.errors = serverData.errors;
				}
			}.bind({sf: this}),

			upload_complete_handler : function () {
				var bt = $(this.sf._swfu.customSettings.cancelButtonId);
				if (this.sf._swfu.getStats().files_queued === 0 && bt) {
					bt.disabled = true;
				}
			}.bind({sf: this})/*,

			queue_complete_handler : function (n) {
				if (!this.sf._swfu.errors) {}
			}.bind({sf: this}),*/
		};

		if (param) {
			swfConf = Object.extend(swfConf, param);
		}

		this._swfu = new SWFUpload( swfConf );
	},

	setButtons : function (b) {
		if (b) {
			this._buto = [$(b)];
		} else {
			this._buto = $$(
				'#' + this._form.id + ' .btSubmit',
				'#' + this._form.id + ' input[type=submit], ',
				'#' + this._form.id + ' button[type=submit]'
			);
		}

		this._buto.each(function (b) {
			if (b.type != 'submit') {
				b.observe('click', this.send.bind(this));
			}
		}, this);
	},

	trataErrors : function (json) {
		var mensagem = '';

		for (var iptId in json.errors) {
			if (Object.isFunction(json.errors[ iptId ])) {
				continue;
			}

			if (Object.isArray(json.errors[ iptId ])) {
				$$(
					'#' + this._form.id + ' input[name="' + iptId + '[]"]',
					'#' + this._form.id + ' select[name="' + iptId + '[]"]',
					'#' + this._form.id + ' textarea[name="' + iptId + '[]"]',
					'#' + this._form.id + ' #' + iptId
				).invoke('addClassName', 'error');

				json.errors[ iptId ].each(function (value) {
					if (value !== true) {
						mensagem = (mensagem ? mensagem + '\n' : '') + value;
					}
				}, mensagem);

			} else {
				$$(
					'#' + this._form.id + ' input[name="' + iptId + '"]',
					'#' + this._form.id + ' select[name="' + iptId + '"]',
					'#' + this._form.id + ' textarea[name="' + iptId + '"]',
					'#' + this._form.id + ' #' + iptId
				).invoke('addClassName', 'error');

				if (json.errors[iptId] !== true) {
					mensagem = (mensagem ? mensagem + '\n' : '') + json.errors[iptId];
				}
			}
		}

		return mensagem;
	},

	showErrors : function (json) {
		var mensagem = this.trataErrors(json);

		try {
			var aw = new ModalAlert({frame: FRAME_TOP, cssClass: 'erro'});
		} catch (e) {
			var aw = new ModalAlert({cssClass: 'erro'});
		}

		if (json.redirect) {
			aw.addButton({'typeFunction': 'ok', 'type': 'button', 'value': 'ok', 'action': function () {
				document.location = json.redirect;
			}.bind(json)});
		} else {
			aw.addButton({'typeFunction': 'ok', 'type': 'button', 'value': 'ok', 'action': function () {
				this.cl.enable();
				this.aw.hide();
				this.cl._form.fire('evt:onPostError');
			}.bind({cl: this, 'aw': aw})});
		}

		aw.show('Erro', (mensagem ? mensagem : 'Oops. Você não preencheu o formulário corretamente.\nVerifique os campos destacados.'), ['ok'], 'ok');
	},

	setShowErrors : function (func) {
		this.showErrors = func.bind(this);
	},

	showSucesso : function (json) {
		if (Object.isString(json.sucesso)) {
			try {
				var aw = new ModalAlert({frame: FRAME_TOP, cssClass: 'sucesso'});
			} catch (e) {
				var aw = new ModalAlert({cssClass: 'sucesso'});
			}
			aw.addButton({'typeFunction': 'ok', 'type': 'button', 'value': 'ok', 'action': function () {
				this.c._form.enable();
				this.aw.hide();
				this.c.onSuccess();
				if (this.redir) {
					this.c.showLoading();
					document.location = this.redir;
				}
			}.bind({c: this, 'aw': aw, redir: (json.redirect ? json.redirect : false)})});
			aw.show('Sucesso', json.sucesso, ['ok'], 'ok');
		} else if (json.redirect) {
			this.showLoading();
			document.location = json.redirect;
		} else {
			this.onSuccess();
			this.enable();
		}
	},

	showLoading : function () {
		if (this._loadType == 'default') {
			this._buto.each(function (b) {
				b.addClassName(this._loadClass);
			}, this);
		} else if (this._loadType == 'full') {
			AguardeTelaCheia.show();
		} else {
			throw '_loadType inexistente.';
		}
	},

	hideLoading : function () {
		if (this._loadType == 'default') {
			this._buto.each(function (b) {
				b.removeClassName(this._loadClass);
			}, this);
		} else {
			AguardeTelaCheia.hide();
		}
	},

	setOnSuccess : function (func) {
		this.onSuccess = func.bind(this);
	},

	onSuccess : function () {
		return;
	},

	setValidateFunc : function (func) {
		this.validate = func.bind(this);
	},

	// valida o form
	validate : function () {
		return true;
	},

	enable : function () {
		this._form.enable();
		this._form.select('._sfDisabled').invoke('disable').invoke('removeClassName', '_sfDisabled');
	},

	setOn403 : function (func) {
		this.on403 = func.bind(this);
	},

	on403 : function (r) {
		try {
			var alertWindow = new ModalAlert({frame: FRAME_TOP, cssClass: 'erro'});
		} catch (e) {
			var alertWindow = new ModalAlert({cssClass: 'erro'});
		}
		alertWindow.show('Atenção', (r.responseJSON.mensagem ? r.responseJSON.mensagem : 'Para executar esta operação, você precisa estar logado.'), ['ok']);
		this.enable();
	},

	setConfirmSend : function (t, m) {
		this._confirmSend = {title: t, message: m};
	},

	send : function (e) {
		try {
			e.stop();
		} catch (e) {}

		if (this.validate()) {
			if (this._confirmSend) {
				try {
					var ma = new ModalAlert({frame: FRAME_TOP, cssClass: 'erro'});
				} catch (e) {
					var ma = new ModalAlert({cssClass: 'erro'});
				}
				ma.addButton({
					'typeFunction': 'ok',
					'type': 'button',
					'value': 'ok',
					'action': function () {
						this.ma.hide();
						this.cl._send();
					}.bind({'cl' : this, 'ma' : ma})
				});
				ma.show(this._confirmSend.title, this._confirmSend.message, ['ok', 'cancel'], 'cancel');
				return false;
			} else {
				this._send();
			}
		}

		return false;
	},

	_send : function () {
		/*
			primeiro varre todos os marcados com erro, e os remove
		*/
		$$('#' + this._form.id + ' .error').invoke('removeClassName', 'error');

		$$('textarea.ckeditor').each(function (tx) {
			tx.update(eval('CKEDITOR.instances.' + tx.name).getData());
		});

		if (this._swfu && this._swfu.getStats().files_queued) {
			this._form.serialize().split('&').each(function (s) {
				var dados = s.split('=');
				this._swfu.addPostParam(dados[0], dados[1]);
			}, this);

			this._swfu.startUpload();

		} else {
			this.showLoading();
			this._form.fire('submit');
			this._form.request({
				onFailure : function (e) {
					this.enable();

					this.hideLoading();

					try {
						var aw = new ModalAlert({frame: FRAME_TOP, cssClass: 'erro'});
					} catch (e) {
						var aw = new ModalAlert({cssClass: 'erro'});
					}
					aw.addButton({'typeFunction': 'ok', 'type': 'button', 'value': 'ok', 'action': function () {
						this.aw.hide();
						this.cl._form.focusFirstElement();
					}.bind({'aw': aw, 'cl': this})});

					aw.show('Oops.', 'Houve um erro no servidor. Nossa equipe técnica já foi notificada e em breve estará solucionando este problema. (#1040)', ['ok'], 'ok');
				}.bind(this),

				on403: this.on403.bind(this),

				onComplete: function(r) {
					this.hideLoading();

					this._res = r;
					try {
						var json = r.responseJSON;

						if (json.errors) {
							this.showErrors(json);
						} else {
							this.showSucesso(json);
						}
					} catch (e) {
						this._form.enable();

						try {
							var aw = new ModalAlert({frame: FRAME_TOP, cssClass: 'erro'});
						} catch (e) {
							var aw = new ModalAlert({cssClass: 'erro'});
						}
						aw.addButton({'typeFunction': 'ok', 'type': 'button', 'value': 'ok', 'action': function () {
							this.aw.hide();
							this.cl._form.focusFirstElement();
						}.bind({'aw': aw, 'cl': this})});

						aw.show('Oops.', 'Houve um erro no servidor. Nossa equipe técnica já foi notificada e em breve estará solucionando este problema. (#1041)', ['ok'], 'ok');
					}
				}.bind(this)
			});

			this._form.getInputs().each(function (i) {
				if (i.disabled) {
					i.addClassName('_sfDisabled');
				}
			});

			this._form.disable();
		}
	}
});

