String.prototype.slug = function(){
	var str = (this.trim().stripTags().toLowerCase()).replace(/\s+/, ' ').replace(/[^\w\s+à-üÀ-Ü]|[+-]/g, ''),
		from = 'ãàáäâ?èéëêìíïîõòóöôùúüûñç·/_,:; \'',
		to = 'aaaaaeeeeeiiiiooooouuuunc---------';

		str = str.replace(/[à-üÀ-Ü_,:;\s+]/g, function(m){
			 return to[from.indexOf(m)];
		});

		return str.trim();
};

