};

LoadImg = Class.create({
	_conf:{},
	initialize:function(options)
	{
		this._conf = Object.extend({
			_class:'load-img',
			scrolled:false,
			src:URL_IMG.concat('/principal/icones/logo-hu-carregando.gif'),
			width:'100px',
			height:'100px',
			border:0,
			margin:'62px'
		}, options);

		this._load();

		/**
		 * Ativa LoadImg para scroolled::
		 */
		if( this._conf.scrolled ){
			Event.observe(window, 'scroll', this._load.bind({_conf:this._conf}));

		}//if
	},

	_load:function()
	{
		try
		{
			imgs = {};

			$$(".".concat(this._conf._class)).each(function(e, i){
				if( (e.viewportOffset()[1] > document.viewport.getHeight() ) && this._conf.scrolled )
					return ;

				var data = $(e).readAttribute('src-data');
					imgs['img_load_'.concat(i)] = new Image();

					$(e).setStyle({width:this._conf.width, height:this._conf.height, border:this._conf.border, margin: this._conf.margin});
					$(e).setAttribute('src', this._conf.src);
					$(e).addClassName('loadEfectImg');

					/**
					 * Após a imagem estar carregada, esse callback é chamado::
					 */
					imgs['img_load_'.concat(i)].onload = function(){
						setTimeout(function(){
							new Effect.Opacity($(e), { from: 0, to: 1 });
							$(e).src = this.src;
							$(e).setAttribute('src-data', null);
							$(e).setAttribute('style', null);
							$(e).removeClassName(this._class);
							$(e).removeClassName('loadEfectImg');
						}.bind({src:this.src, _class:this._class}), 1500);

						delete imgs[ 'img_load_'.concat(i) ];

					}.bind({_class:this._conf._class, src:data});

					imgs['img_load_'.concat(i)].src = data;

					/**
					 * Caso a imagem não carregue, a imagem default é colocada::
					 */
					imgs['img_load_'.concat(i)].onerror = function(){
						$(e).hide();
						$(e).src = URL_IMG.concat("/sem-imagem-hotel.jpg");
						$(e).setAttribute('src-data', null);
						$(e).setAttribute('style', null);
						$(e).removeClassName(this._class);
						$(e).removeClassName('loadEfectImg');

						new Effect.Opacity($(e), { from: 0, to: 1 });
						delete imgs[ 'img_load_'.concat(i) ];

					}.bind({_class:this._conf._class, src:data});

			}.bind({_conf:this._conf}) );

		}catch(error){ /**/ }
	}
});

