/*verifica o status de login do usuário no Facebook, dependendo do status efetua o login*/
function statusFacebook() {
	FB.getLoginStatus( function(response) {
		if (response.status === 'connected') {
			loginUserHU();
		} else if (response.status === 'not_authorized') {
			login(); // nao autorizado, solicitar login
		} else {
			login(); // nao autorizado, solicitar login
		} 
	});
}

/*chama um método por ajax para detectar se usuário já é cadastrado em nossa base e fazer o login no site através do facebook*/
function loginUserHU() {
	/*Fazendo o ajax para o login no site*/
	new Ajax.Request(URL_FACEBOOK_LOGIN, {

		method: 'post',

		onFailure: function(r) {
		},
		onSuccess: function (r) {
			json = r.responseJSON;

			if (json.loginFB == 'Site') {	
				/*Se o método php logou e/ou cadastrou o usuario no site*/
				window.location.href = document.URL;
			} else if (json.loginFB == 'CustomAudience') {

				/*fechando o iframe de cadastro*/
				/*dando um reload na grade de registros com a mensagem de sucesso*/
				parent.Consultar.request_ajax({
					type : 'sucesso',
					mensagem : json.sucesso,
					closeHS : true
				});
			}
		}

	});
}

