//stream publish method
function streamPublish(name, description, hrefTitle, hrefLink, caption, hrefAttachment, srcImage, idPedido){

	FB.ui(
	{
		method: 'stream.publish',
		display: 'popup',
		user_message_prompt: '',
		message: '',
		attachment: {
			name: name,
			caption: caption,
			description: (description),
			href: hrefAttachment,
			media: [
				{ 
					'type': 'image',
					'src': srcImage,
					'href': 'http://' + FACEBOOK_URI
				}
			]
		},
		action_links: [
			{ text: hrefTitle, href: hrefLink }
		]

	},
   function(response) {
	 /*verificando se o usuário realmente fez um post(compartilhamento) no face e se está sendo passado o id do pedido*/ 
     if (response && response.post_id && typeof idPedido != 'undefined' && !isNaN(idPedido) ) {

		/*Fazendo o ajax para salvar o cupom de desconto do usuário*/
		new Ajax.Request(URL_FACEBOOK_CUPOM_AO_COMPARTILHAR, {

			method: 'post',
			parameters: {'pedido': idPedido},
			onFailure: function(r) {
				 var aw = new ModalAlert({cssClass: 'erro'});
				aw.show('Atenção', 'Ocorreu um erro ao tentar gerar o cupom de desconto, favor tente novamente. Se o problema persistir entre em contato conosco. Obrigado.', ['ok'], 'ok');
			},
			onSuccess: function (r) {

				json = r.responseJSON;

				if (json.sucesso) {
					var aw = new ModalAlert({cssClass: 'sucesso'});
					aw.show('Atenção', json.sucesso, ['ok'], 'ok');
				} else if ((json.errors))  {
					var aw = new ModalAlert({cssClass: 'erro'});
					aw.show('Atenção', json.errors.msgErro, ['ok'], 'ok');
				} else {
					var aw = new ModalAlert({cssClass: 'erro'});
					aw.show('Atenção', 'Ocorreu um erro ao tentar gerar o cupom de desconto, favor tente novamente. Se o problema persistir entre em contato conosco. Obrigado.', ['ok'], 'ok');
				}

			}

		});	   

     } else {
		if (typeof idPedido != 'undefined' && !isNaN(idPedido) ) {
			 console.log('Post não publicado. Não foi possiível criar o cupom');
			 var aw = new ModalAlert({cssClass: 'erro'});
			aw.show('Atenção', 'Atenção, sua viagem não foi compartilhada.', ['ok'], 'ok');
		}
     }
   });

}

function showStream(name,description,hrefTitle,caption,hrefAttachment,srcImage,idPedido){
	FB.api('/me', function(response) {
		streamPublish(name, description, hrefTitle, 'http://' + FACEBOOK_URI, caption, hrefAttachment, srcImage, idPedido);
	});
}

