	validar:function()
	{
		var form_tpl = "";

		if( /-scroll/.test( $(this.form).up().id ) ) {
			form_tpl = "-scroll";
		}else if( /suaPesquisa/.test( $(this.form).up().id ) ) {
			form_tpl = "-interna";
		}//if


		var /*-- inputs:: --*/
				checkin = $('input-data-checkin'.concat(form_tpl)),
				checkout = $('input-data-checkout'.concat(form_tpl)),
				quartos = $("selQtosQuartos".concat(form_tpl)),
				cidade = $('input-busca-por-hotel'.concat(form_tpl)),

			/*-- errors:: --*/
				erros = new Array();

			var in_busca = $('input-busca-por-hotel'.concat(form_tpl)).name.split('|');
			if (in_busca.size() < 2) {
				erros.push('Você precisa digitar o nome da cidade.');
			} else if( cidade.name.trim() != 'c' )
				cidade.removeClassName('error');
			else{
				if( !cidade.value.trim().length || cidade.value.trim() == 'Digite a cidade de destino')
					erros.push('Você precisa digitar o nome da cidade.');
				else
					erros.push('infelizmente essa cidade não foi encontrada. Tente uma nova busca.');
				cidade.addClassName('error');
			}//if

			if( /^[0-9]{4}-(0[1-9]|1[0-2])-(0[1-9]|[1-2][0-9]|3[0-1])$/.test( checkin.value.split('/').reverse().join('-') ) )
				checkin.removeClassName('error');
			else{
				erros.push('Você precisa preencher a data de hospedagem.');
				checkin.addClassName('error');
			}//if

			if( /^[0-9]{4}-(0[1-9]|1[0-2])-(0[1-9]|[1-2][0-9]|3[0-1])$/.test( checkout.value.split('/').reverse().join('-') ) )
				checkout.removeClassName('error');
			else{
				erros.push('Você precisa preencher a data de hospedagem.');
				checkout.addClassName('error');
			}//if

			if( quartos.value != '0' )
				quartos.removeClassName('error');
			else{
				erros.push('Você precisa selecionar a quantidade de quartos.');
				quartos.addClassName('error');
			}//if


			if( erros.length ){
				throw erros.join("\n");
			}//if

			return form_tpl;
	}
},

quartos = {
	tpl:null,
	cache:{},

	init:function(){
		quartos.clean_cache();

		$$('#selQtosQuartos, #selQtosQuartos-scroll, #selQtosQuartos-interna').invoke('observe', 'change', quartos.set_acomodacoes);
	},

	clean_cache:function()
	{
		quartos.cache = {
			url_img:URL_IMG,
			p_crianca:false,
			f_crianca:0,
			qtdquartos:0,
			acomodacoes: {
				1:{adultos:1, idade:{1:0,2:0,3:0}, criancas:0},
				2:{adultos:1, idade:{1:0,2:0,3:0}, criancas:0},
				3:{adultos:1, idade:{1:0,2:0,3:0}, criancas:0}
			}
		};

	},

	/**
	 * Seta as informações sobre a quantidae de adultos::
	 */
	set_adulto:function()
	{
		var op = parseInt( this.value )
			pos = ( this.id.split('-')[1] );

		quartos.cache['acomodacoes'][pos]['adultos'] = op;

	},

	/***
	 * Seta as informações sobre acomodação::
	 */
	set_acomodacoes:function()
	{
		var _tpl = quartos.get_t(this),
			tpl = new jSmart($(_tpl.template).innerHTML);

		if( quartos.cache.qtdquartos = parseInt( this.value ) )
		{
			var data = quartos.cache;
			$(_tpl.display).update( tpl.fetch( data ) );

			return ;

		}//if

		quartos.clean_cache();
		$(_tpl.display).update( '' );
	},

	/**
	 * Seta quantidade de crianças::
	 */
	set_crianca:function()
	{
		var op = parseInt( this.value ),
			pos = ( this.id.split('-')[1] ),
			ac = quartos.cache['acomodacoes'];

		/***
		 * Seta as informações sobre a quantidade de crianças::
		 */
			quartos.cache['acomodacoes'][pos]['criancas'] = op;
			quartos.cache['f_crianca'] = Math.max( ac[1]['criancas'], ac[2]['criancas'], ac[3]['criancas'] );
			quartos.cache['p_crianca'] = Boolean( quartos.cache['f_crianca'] > 0 );

		if(!op)
		{
			/***
			 * Zera informações sobre a idade das crianças, na acomodação::
			 */
				quartos.cache['acomodacoes'][pos]['idade'] = {};

		}

		var _tpl = quartos.get_t(this),
			tpl = new jSmart($(_tpl.template).innerHTML)
			data = quartos.cache;

		$(_tpl.display).update( tpl.fetch( data ) );

	},

	/***
	 * Seta idade das crianças por quarto::
	 */
	set_idade:function(quarto, pos)
	{
		quartos.cache['acomodacoes'][quarto]['idade'][pos] = parseInt(this.value);

	},

	/**
	 * Método recupera a template que está em focus::
	 */
	get_t:function(input)
	{
		var _return = {template:'template-acomodacoes', display:'outras-informacoes'};

		try
		{
			/**
			 * Esse bloco é utilizado para verificar qual template deve ser útilizada,
			 * para montar as informações da busca de hotéis e monte seu pacote.
			 */
			if( /-scroll/.test( $(input.form).up().id ) ){
				_return.template = _return.template.concat('-scroll');
				_return.display = _return.display.concat('-scroll');
			}
			else if( /suaPesquisa/.test( $(input.form).up().id ) ){
				_return.template = _return.template.concat('-suaPesquisa');
				_return.display = _return.display.concat('-suaPesquisa');

			}//if

		}catch(error){ /**/ }

		return _return;

	}
};

