neemuPlugin.recommendation = {};
neemuPlugin.clickList = undefined;

var URL_NEEMU_BUSCA = 'http://busca.hotelurbano.com/busca.php?q={termo}';
var NEEMU_TRAFFIC_VALUE = 1;

/*adiciona busca neemu no scroll*/
var homeAutocomplete = function() {
	var form = jQuery('#campo-busca-interna').parent();
	form.bind('submit', function(evt) {
		evt.preventDefault();
		evt.stopPropagation();
		var inputText = jQuery('#buscaInteligenteScroll').val();
		if ( inputText == 'Paraondevocêquerir?' || inputText === '' ) {
			alert('Digite uma busca válida.');
		} else {
			var urlSearch = URL_NEEMU_BUSCA.replace('{termo}', inputText);
			document.location.href = urlSearch;
		}
	});
};

/*Busca Neemu*/
var searchNeemu = function() {
	//Recupera o formulario
	var form = jQuery('fieldset.centroPagina').parent();
	form.bind('submit', function(evt) {
		evt.preventDefault();
		evt.stopPropagation();
		var inputText = jQuery('#input-busca-principal').val();
		if ( inputText == 'Paraondevocêquerir?' || inputText === '' ) {
			alert('Digite uma busca válida.');
		} else {
			var urlSearch = URL_NEEMU_BUSCA.replace('{termo}', inputText);
			document.location.href = urlSearch;
		}
	});
};

var neemuLoadAutocomplete = function() {
	try {
		if ( !(window.location.href.match('^https')) ) {
			var s = document.createElement('script');
			s.setAttribute("type","text/javascript");
			s.setAttribute("src", 'http://scripts.neemu.com/hotelurbano/neemu_plugin.js');
			s.setAttribute('async', true);
			s.onload = function() {
				var ul2 = document.getElementById('ui-id-2');
				var ul3 = document.getElementById('ui-id-3');
				if (ul2 !== null) {
					document.getElementById('ui-id-2').style.display = 'none';
				}
				if (ul3 !== null) {
					document.getElementById('ui-id-3').style.display = 'none';
				}
                jQuery('#buscaInteligenteScroll').unbind();

			};
			var head = document.getElementsByTagName('head')[0];
			head.appendChild(s);
		}
	} catch (err) {
	}
};

