neemuPlugin.productInformation = undefined;
neemuPlugin.parseProductPage = function() {
	if (undefined === neemuPlugin.productInformation) {
		neemuPlugin.productInformation = {
			'id' : "",
			'summary':"",
			'productType' : "",
			'productTypeId' : "",
			'title' : "",
			'imageLink' : "",
			'link' : "",
			'availability' : "",
			'priceCampaign' : "",
			'price' : "",
			'salePrice' : "",
			'installment' : {
				'months': "",
				'amount': ""
			},
			'skuList':[]
		};
		
		try {
			neemuPlugin.productInformation.id = window.zx_identifier || window.dataLayer[0].offer_id;
		} catch (error) {
			var getId = window.location.href.split("/");
			for (var i = 0; i < getId.length; i++) {
				if ( IsNumeric(getId[i]) ) {
					neemuPlugin.productInformation.id = getId[i];
					break;
				}
			};
		}

		if ( window.location.href.indexOf("?cmp=") >= 0 ) {
