			var strongNode = domTitle.getElementsByTagName('strong');
			if (strongNode.length > 0) {
				neemuPlugin.productInformation.title = strongNode[0].innerHTML.replace(/&nbsp;/g, ' ');
			} else {
				neemuPlugin.productInformation.title = domTitle.innerHTML;
