		}

		if ( neemuPlugin.productInformation.availability == true ) {
			try {
				if ( document.getElementsByClassName("cinza font12 mgTop10")[0].getElementsByTagName("strike")[0].innerHTML.indexOf(",") >= 0 ) {
					neemuPlugin.productInformation.price = neemuPlugin.formatCurrency(document.getElementsByClassName("cinza font12 mgTop10")[0].getElementsByTagName("strike")[0].innerHTML, "BRL");
					neemuPlugin.productInformation.salePrice = neemuPlugin.formatCurrency(document.getElementsByClassName("font16 laranja2")[0].getElementsByTagName("strong")[0].innerHTML, "BRL");
				} else {
					neemuPlugin.productInformation.price = document.getElementsByClassName("cinza font12 mgTop10")[0].getElementsByTagName("strike")[0].innerHTML.replace(/[^0-9]+/g, "") + ".00 BRL";
					neemuPlugin.productInformation.salePrice = document.getElementsByClassName("font16 laranja2")[0].getElementsByTagName("strong")[0].innerHTML.replace(/[^0-9]+/g, "") + ".00 BRL";
				}
			} catch (error) {
				if ( document.getElementsByClassName("font16 laranja2")[0].getElementsByTagName("strong")[0].innerHTML.indexOf(",") >= 0 ){
					neemuPlugin.productInformation.salePrice = neemuPlugin.formatCurrency(document.getElementsByClassName("font16 laranja2")[0].getElementsByTagName("strong")[0].innerHTML, "BRL");
				} else {
					neemuPlugin.productInformation.salePrice = document.getElementsByClassName("font16 laranja2")[0].getElementsByTagName("strong")[0].innerHTML.replace(/[^0-9]+/g, "") + ".00 BRL";
				}
				neemuPlugin.productInformation.price = neemuPlugin.productInformation.salePrice;
