			var parcelValue = document.getElementsByClassName("laranja2");
			for ( var i = 0; i < parcelValue.length; i++ ) {
				if ( parcelValue[i].innerHTML.indexOf("de R$") >= 0 ) {
					neemuPlugin.productInformation.installment = {
						'months': parcelValue[i].innerHTML.split("x")[0].replace(/[^0-9]+/g, ""),
						'amount': neemuPlugin.formatCurrency(parcelValue[i].innerHTML.split("x")[1], "BRL")
					}
				}

				if ( neemuPlugin.productInformation.installment.months == '' ) {
					neemuPlugin.productInformation.installment = {
						'months': '1',
						'amount': neemuPlugin.productInformation.salePrice
					};
				}
			};
		}

		if ( document.getElementsByClassName("valores-pacote").length > 0 ) {
			var skuNum = document.getElementsByClassName("valores-pacote");
			for ( var i = 0; i < skuNum.length; i++ ) {
				var sku = {};
				sku.sku = skuNum[i].getElementsByTagName("button")[0].getAttribute("onclick").split("op=")[1].replace(/[^0-9]+/g, "");
				sku.availability = true;
				if (skuNum[i].getElementsByTagName("strong")[0].innerHTML.indexOf(",") >= 0 ) {
					sku.price = neemuPlugin.formatCurrency(skuNum[i].getElementsByTagName("strong")[0].innerHTML, "BRL");
					sku.salePrice = sku.price;
				} else {
					sku.price = skuNum[i].getElementsByTagName("strong")[0].innerHTML.replace(/[^0-9]+/g, "") + ".00 BRL";
					sku.salePrice = sku.price;
				}
				sku.installment = {};
				sku.installment.months = 1;
				sku.installment.amount = sku.price;
				neemuPlugin.productInformation.skuList.push(sku);
			}
		} else {
			var sku = {};
			sku.sku = document.getElementById("precos-pacote").getElementsByTagName("button")[0].getAttribute("onclick").split("op=")[1].replace(/[^0-9]+/g, "");
			sku.availability = neemuPlugin.productInformation.availability;
			if ( sku.availability == true ) {
				sku.price = neemuPlugin.productInformation.price;
				sku.salePrice = neemuPlugin.productInformation.salePrice;
				sku.installment = neemuPlugin.productInformation.installment;
			}
			neemuPlugin.productInformation.skuList.push(sku);
		}
	}
	return neemuPlugin.productInformation;
}

