				charCode = 10;
				this._index += 2;
			}

			if ( charCode < 128 ) {
				this.current = charCode;
			} else if ( (charCode > 127) && (charCode < 2048) ) {
				this.current = (charCode >> 6) | 192;
				this._buffer.push((charCode & 63) | 128);
