var neemuPlugin = neemuPlugin || {};

neemuPlugin.session_id = neemuPlugin.getSessionID();
neemuPlugin.permanent_session_id = neemuPlugin.getPermanentSessionID();
neemuPlugin.referrer = document.referrer;


neemuPlugin.logInformation = {};
neemuPlugin.parsePage = function()
{
	var pageType = neemuPlugin.getPageType();
	neemuPlugin.logInformation.generalInfo = neemuPlugin.parseGeneralInformation();
	neemuPlugin.logInformation.generalInfo.referrer = neemuPlugin.referrer;
	neemuPlugin.logInformation.generalInfo.pageType = pageType;
	neemuPlugin.logInformation.generalInfo.userAgent = navigator.userAgent;
	neemuPlugin.logInformation.generalInfo.sid = neemuPlugin.getSessionID();
	neemuPlugin.logInformation.generalInfo.psid = neemuPlugin.getPermanentSessionID();
	if(pageType == neemuPlugin.LOGIN_PAGE)
	{
		neemuPlugin.logInformation.loginInformation = neemuPlugin.parseLoginPage();
	}
	else if(pageType == neemuPlugin.HOME_PAGE)
	{
		neemuPlugin.logInformation.homeInformation = neemuPlugin.parseHomePage();
	}
	else if(pageType == neemuPlugin.SEARCH_PAGE)
	{
		neemuPlugin.logInformation.searchInformation = neemuPlugin.parseSearchPage();
	}
	else if(pageType == neemuPlugin.DEPARTMENT_PAGE)
	{
		neemuPlugin.logInformation.departmentInformation = neemuPlugin.parseDepartmentPage();
	}
	else if(pageType == neemuPlugin.PRODUCT_PAGE)
	{
		neemuPlugin.logInformation.productInformation = neemuPlugin.parseProductPage();
	}
	else if(pageType == neemuPlugin.CART_PAGE)
	{
		neemuPlugin.logInformation.cartInformation = neemuPlugin.parseCartPage();
	}
	else if(pageType == neemuPlugin.CHECKOUT_PAGE)
	{
		neemuPlugin.logInformation.checkoutInformation = neemuPlugin.parseCheckoutPage();
	}
	else if(pageType == neemuPlugin.CHECKOUT_CONFIRMATION_PAGE)
	{
		neemuPlugin.logInformation.checkoutConfirmationInformation = neemuPlugin.parseCheckoutConfirmationPage();
	}
	else if(pageType == neemuPlugin.COMPARISON_PAGE)
	{
		neemuPlugin.logInformation.comparisonInformation = neemuPlugin.parseComparisonPage();
	} else if (pageType == neemuPlugin.CATEGORY_PAGE)
	{
		neemuPlugin.logInformation.categoryInformation = neemuPlugin.parseCategoryPage();
	}
};

if(typeof JSON === 'object' && typeof JSON.stringify === 'function'){
	if(window.Prototype) {
		delete Object.prototype.toJSON;
		delete Array.prototype.toJSON;
		delete Hash.prototype.toJSON;
		delete String.prototype.toJSON;
	}
	neemuPlugin.neemuObjectToJson = JSON.stringify;
}
else{
   neemuPlugin.neemuObjectToJson = Object.toJSON;
}

try {
	neemuPlugin.parsePage();
	neemuPlugin.logInfo = neemuBase642.encode(neemuPlugin.neemuObjectToJson(neemuPlugin.logInformation));

	neemuPlugin.scriptSrc = neemuPlugin.protocol+
				neemuPlugin.logServerNeemu+
				'/grava.php?callback=neemuCallback'+
				'&psid='+neemuPlugin.permanent_session_id+
				'&sid='+neemuPlugin.session_id+
				'&log='+neemuPlugin.logInfo;
} catch(e) {
	neemuPlugin.logInfo = {
		'message': e.message,
		'url': window.location.href,
		'extraInfo': e,
		'userAgent': navigator.userAgent,
		'version': neemuPlugin.version || 0
	};
	neemuPlugin.scriptSrc = neemuPlugin.protocol+
				neemuPlugin.logServerNeemu+
				'/grava.php?callback=neemuCallback'+
				'&psid='+neemuPlugin.permanent_session_id+
				'&sid='+neemuPlugin.session_id+
				'&logErro='+neemuBase642.encode(neemuPlugin.neemuObjectToJson(neemuPlugin.logInfo));
}

if ((navigator.userAgent.indexOf("Googlebot")) < 0 || (navigator.userAgent.indexOf("BingPreview")) < 0){
	neemuPlugin.script = window.document.createElement('script');
	neemuPlugin.script.src = neemuPlugin.scriptSrc;

	window.document.getElementsByTagName('head')[0].appendChild(neemuPlugin.script);
}
